import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import login from './Components/login_page.js';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      time: new Date().toLocaleTimeString(),
    }
  }
  render() {
    return (
        <div className="login">
            <login />
            <h2>It is {this.state.time}.</h2>
        </div>
